INSERT [dbo].[Page] ([Id], [ShortName], [FullName], [Description], [ImageData], [ImageMime], [Created], [Modified], [CreatedById], [ModifedById]) VALUES (12, N'John', N'John Doe', N'<p>Carina Kindl is a young, noble Reiklander, born and raised near the Imperial capital of Aldorf. She has a romanticised view of the Wild N bvorth and so took up her education in Middenheim (which has a University, can you belive it?), the last bastion of civilization in the Northern Empire. </p>
<p>&nbsp;<img src="data:image/jpeg;base64," alt="" /></p>
<p>Although quite smart and well educated (she studied as a navigator at Middenhiem''s Cartography Institute and speaks Brettonian and Tilean as well as Reikspiel), Carina is na&iuml;ve and perhaps a little foolhardy.</p>
<p>Carina is also a keen archer, but at only five feet tall she struggles to pull a longbow. She prefers using a cavalry bow even though she can''t actually ride a horse, because the shallow tail means she can pull a longer string without the bottom catching on the ground.</p>
<p>&nbsp;</p>
<div class="floatnone">
<div class="image_frame"><br />
<div class="caption">Carina Kindl - Archer &amp; Navigator</div>
</div>
</div>', NULL, NULL, CAST(0x0000A4C501276C0A AS DateTime), CAST(0x0000A4C601626F08 AS DateTime), 1, 1)
GO
