INSERT [dbo].[Page] ([Id], [ShortName], [FullName], [Description], [ImageData], [ImageMime], [Created], [Modified], [CreatedById], [ModifedById]) VALUES (16, N'Frank log 1', N'Frank goes to town on the ;', N'<p>I like the idea of shaking up the initiative order a bit &ndash; but I&rsquo;m not really clear on how this particular set up would work in practice. Perhaps one to test in a sandbox to see how it works?</p>
<p><img src="data:image/jpeg;base64," alt="" /></p>
<p>One minor change I think seems to make sense would be for the winner of a clash to go in front, regardless of who initiated it &ndash; as they have, by definition, just taken a hit (even if it was just a meta-hit with the new wounding thing).</p>
<p>I&rsquo;m a little concerned that it might create a little meta-game round the wheel mechanic &ndash; but we won&rsquo;t know till we try it out I guess?</p>', , N'Image/Jpeg', CAST(0x0000A4C601442C46 AS DateTime), CAST(0x0000A4C601669ED3 AS DateTime), 1, 1)
GO
